import './App.css';
import React, { useState, useEffect } from 'react';
import {Header, Button} from './components/common';
import Background from './background.svg';
function App() {
  return (
    <div className="App">
      <Header/>
      <Button onClick={()=> {console.log("hello world")}}
      type="">helo</Button>
    </div>
  );
}

export default App;
